  false,\n\t\"url\": null,\n\t\"notes\": \"Hourly measurements made by selected ship
  sensors on the R/V Atlantis during the \"Expedition to the Deep Slope 2006\" expedition
  sponsored by the National Oceanic and Atmospheric Administration (NOAA) Office of
  Ocean Exploration and the Minerals Management Service (MMS), May 7 through June
  2, 2006. Measurements include ship's position and heading, air temperature, relative
  humidity, barometric pressure, and wind speed and direction. This data set was compiled
  from the shipboard navigation system.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
